import React from "react";

function GroceryInput({ value, onChange, dispatch }) {
  return (
    <div>
      <input
        type="text"
        value={value}
        onChange={(event) => onChange(event.target.value)}
      />
      <button onClick={() => dispatch(value)}>Add Grocery</button>
    </div>
  );
}

export default GroceryInput;
